import React from 'react';



const Todoitem=(props)=>{

    return(
        <div className="Todoitem">
                this is item
            <div className="start_time" key={props.item.start_time}></div>
            <div className="end_time" key={props.item.end_tiem}></div>
            <div className="more" key={props.item.content}></div>
        </div>  
    );

};

export default Todoitem;
